import React from 'react';
import Card from '../Card/Card';
import './Cards.css';

function Cards({allPokemons}) {

  const pokemons = ({allPokemons})

  return (

    <div className="">
        {
        allPokemons?.map(pokemon=>{
          return <Card
            key={pokemon.id}
            id={pokemon.id}
            name={pokemon.name}
            hp={pokemon.hp}
            attack={pokemon.attack}
            defense={pokemon.defense}
            image={pokemon.image}

          />
        })}

    </div>
  )
}

export default Cards
